import React from 'react';
import './secondTitle.css';

const SecondTitle = () => {
    return (
        <div className='secondTitle'>
            <h2>Что такое кофе?</h2>
            <p>Как его пить и полезная информация</p>
        </div>
    );
};

export default SecondTitle;
